import React from "react";
import { Card } from "react-bootstrap";
import Text from "../../components/Text";

function Landing() {
  return (
    <Text>
      <Card.Body>
        <Card.Title>Be truly borderless</Card.Title>
      </Card.Body>
    </Text>
  );
}

export default Landing;
